import React from "react";
import Button from '@mui/material/Button';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import LunchDiningIcon from '@mui/icons-material/LunchDining';
import Box from '@mui/material/Box';

function MenuMUI () {
  const [anchorFood, setOpenFood] = React.useState(null);
  const [anchorSleep, setOpenSleep] = useState(null);

  function handleClick(event) {
    if (anchorEl !== event.currentTarget) {
      setAnchorEl(event.currentTarget);
    }
  }

  function handleClose() {
    setAnchorEl(null);
  }

  return (
    <Box>
      <Button
        aria-owns={anchorEl ? "simple-menu" : undefined}
        aria-haspopup="true"
        onClick={handleClick}
        onMouseOver={handleClick}
        variant="outlined" color='inherit'
      >
        <LunchDiningIcon/>Ruoka
      </Button>
      <Menu
        anchorOrigin={{ vertical: "bottom", horizontal: "left" }}
        transformOrigin={{ vertical: "top", horizontal: "left" }}
        id="simple-menu"
        anchorEl={anchorEl}
        open={Boolean(anchorEl)}
        onClose={handleClose}
        MenuListProps={{ onMouseLeave: handleClose }}
        getContentAnchorEl={null}
      >
        <MenuItem onClick={handleClose}>Ruokalista</MenuItem>
        <MenuItem onClick={handleClose}>Lisää ruoka</MenuItem>
      </Menu>
    </Box>
  );
}

export default Hover;
